import React, { Component} from "react";
import { Joystick } from "react-joystick-component";

class Teleoperation extends Component{

    state={};

    render(){
        return(
            <div>
                <Joystick>
                    size={100} 
                    sticky={true} 
                    baseColor="red" 
                    stickColor="blue" 
                    move={handleMove} 
                    stop={handleStop}
                </Joystick>
            </div>
        );
    }



}



export default Teleoperation;
